pragma solidity ^0.5.0;

contract ewaste{

    address public owner;
    uint public _p_id =0;
    uint public _u_id =0;
    uint public _t_id=0;

    constructor() public{
        owner = msg.sender;
    }
    struct track_product {
        uint _product_id;
        uint _prev_owner_id;
        uint _new_owner_id;
        address _prev_product_owner;
        address _new_product_owner;
        string _transfer_type;
        uint _timeStamp;
    }
    mapping(uint => track_product) public tracks;
   
    struct product {
        string _product_name;
        uint _product_cost;
        string _product_specs;
        string _product_review;
        address _product_owner;
        uint _manufacture_date;
        address _mfg;
        address _sup;
        address _ret;
        address _cust;
        uint _expiry_date;
    }
    mapping(uint=>product) public products;
   
    struct participant {
        string _userName;
        string _passWord;
        string _userType;
        address _address;
        //uint rating =0;
    }
    mapping(uint => participant) public participants;
    modifier onlyOwner(uint pid)
    {
        require(msg.sender == products[pid]._product_owner,"Only owner can transfer the product");
        _;
    }
    
    event ProductExpired(uint product_id, address prod_owner);

    function checkifprodexpired(uint product_id)public {

        if(products[product_id]._expiry_date>=now)
        {
            emit ProductExpired(product_id,products[product_id]._product_owner);
        }
    }

    function createParticipant(string memory name,string memory pass,string memory utype) public returns (uint){
        uint user_id = _u_id++;
        participants[user_id]._userName = name;
        participants[user_id]._passWord = pass;
        participants[user_id]._userType = utype;
        participants[user_id]._address = msg.sender;
        return _u_id;
    }

    function newProduct(uint own_id, string memory name,uint p_cost,string memory p_specs,string memory p_review) public returns (uint) {
        if(keccak256(abi.encode(participants[own_id]._userType)) == keccak256(abi.encode("Manufacturer"))) {
            uint product_id = _p_id++;
           
            products[product_id]._product_name = name;
            products[product_id]._product_cost = p_cost;
            products[product_id]._product_specs = p_specs;
            products[product_id]._product_review = p_review;
            products[product_id]._product_owner = participants[own_id]._address;
            products[product_id]._manufacture_date = now;
            products[product_id]._mfg = participants[own_id]._address;
            return product_id;
        }
        
        return 0;
    }
    function getParticipant(uint p_id) public returns (string memory,address,string memory) {
        return (participants[p_id]._userName,participants[p_id]._address,participants[p_id]._userType);
    }
    function getProduct_details(uint prod_id) public returns (string memory,uint,string memory,string memory,address,uint){
        return (products[prod_id]._product_name,products[prod_id]._product_cost,products[prod_id]._product_specs,products[prod_id]._product_review,products[prod_id]._product_owner,products[prod_id]._manufacture_date);
    }
    function transferOwnership_product(uint user1_id,uint user2_id, uint prod_id) onlyOwner(prod_id) public returns(bool) {
        //require(msg.sender == products[prod_id]._product_owner);
        participant memory  p1 = participants[user1_id];
        participant memory  p2 = participants[user2_id];
        //track_product  trk;
        uint track_id = _t_id++;
        tracks[track_id]._product_id = prod_id;
        tracks[track_id]._prev_product_owner = p1._address;
        tracks[track_id]._new_product_owner = p2._address;
        tracks[track_id]._prev_owner_id = user2_id;
        tracks[track_id]._new_owner_id = user2_id;
        tracks[track_id]._timeStamp = now;
        if(keccak256(abi.encode(p1._userType)) == keccak256(abi.encode("Manufacturer")) && keccak256(abi.encode(p2._userType))==keccak256(abi.encode("Supplier"))){
          
            tracks[track_id]._transfer_type = "M2S";
            products[prod_id]._product_owner = p2._address; 
            products[prod_id]._sup=p2._address;
            return (true);
        }
        else if(keccak256(abi.encode(p1._userType)) == keccak256(abi.encode("Supplier")) && keccak256(abi.encode(p2._userType))==keccak256(abi.encode("Retailer"))){

            tracks[track_id]._transfer_type = "S2R";
            products[prod_id]._product_owner = p2._address;
            products[prod_id]._ret = p2._address;
            return (true);
        }
        else if(keccak256(abi.encode(p1._userType)) == keccak256(abi.encode("Retailer")) && keccak256(abi.encode(p2._userType))==keccak256(abi.encode("Customer"))){

            tracks[track_id]._transfer_type = "R2C";
            products[prod_id]._product_owner = p2._address;
            products[prod_id]._cust = p2._address;
            return (true);
        }
        else if(keccak256(abi.encode(p1._userType)) == keccak256(abi.encode("Customer")) && keccak256(abi.encode(p2._userType))==keccak256(abi.encode("Ewaste"))){

            tracks[track_id]._transfer_type = "C2E";
            products[prod_id]._product_owner = p2._address;
            products[prod_id]._cust = p2._address;
            return (true);
        }
        else if(keccak256(abi.encode(p1._userType)) == keccak256(abi.encode("Manufacturer")) && keccak256(abi.encode(p2._userType))==keccak256(abi.encode("Ewaste"))){

            tracks[track_id]._transfer_type = "M2E";
            products[prod_id]._product_owner = p2._address;
            
            return (true);
        }
        else{
            return false;
        }
        checkifprodexpired(prod_id);
    }
    function getProduct_trackindex(uint trck_id)  public  returns (uint,uint,address,uint) {
        
        track_product memory t = tracks[trck_id];
       
        return (t._product_id,t._new_owner_id,t._new_product_owner,t._timeStamp);
    }
    function userLogin(uint uid,string memory uname,string memory pass,string memory utype) public returns (bool){
        if(keccak256(abi.encode(participants[uid]._userType)) == keccak256(abi.encode(utype))){
            if(keccak256(abi.encode(participants[uid]._userName)) == keccak256(abi.encode(uname))) {
                if(keccak256(abi.encode(participants[uid]._passWord))==keccak256(abi.encode(pass))) {
                    return (true);
                }
            }
        }
        return (false);
    }
}
